import React from 'react';
import './ProductList.css';
import {
  Button,
  Container,
  Icon,
  Image,
  Item,
  Label
} from 'semantic-ui-react'

class ProductList extends React.Component {
    render(){   
        return (
        <Container>
        <Item.Group divided>
            <Item>
            <Item.Image src='/images/wireframe/image.png' />

            <Item.Content>
                <Item.Header as='a'>12 Years a Slave</Item.Header>
                <Item.Meta>
                <span className='cinema'>Union Square 14</span>
                </Item.Meta>
                <Item.Extra>
                <Label>IMAX</Label>
                <Label icon='globe' content='Additiobbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbnal Languages' />
                </Item.Extra>
            </Item.Content>
            </Item>
        </Item.Group>
        </Container>
        );
    }  
}

export default ProductList;
